import React from 'react';
import './App.css';

function App() {
  const myQuestions = [
    {
      question: "제일 기분이 좋을때는?",
      option: [
        {text: "늦은밤", score: 6},
        {text: "오후나 이른저녁", score: 4},
        {text: "아침", score: 2}
      ]        
    },
    {
      question: "보통 어떻게 걷는가?",
      option:[
        {text: "보폭을 넓게, 빨리 걷는다.", score: 6},
        {text: "보폭을 좁게, 빨리 걷는다.", score: 4},
        {text: "정면을 바라보며, 더 빠르게 걷는다.", score: 7},
        {text: "바닥을 보며, 덜 빠르게 걷는다.", score: 2},
        {text: "아주 느리게 걷는다.", score: 1}
      ] 
    },
    {
      question: "얘기할때 어떤 자세인가?",
      option: [ 
        {text: "내 팔짱을 끼고 서서", score: 4},
        {text: "두 손을 마주잡고", score: 2},
        {text: "한 손이나 양 손을 힙에 얹고", score: 5},
        {text: "상대방을 건드리거나 살짝 밀면서", score: 7},
        {text: "귀나 턱을 만지거나 머리를 빗으면서", score: 6}
      ]
    },
    {
      question: "쉴 때 어떤 자세인가?",
      option: [
        {text: "다리를 굽힌 채로 나란히 두고 앉는다.", score: 4},
        {text: "다리를 꼬고 앉는다.", score: 6},
        {text: "다리를 쭉 펴고 앉는다.", score: 2},
        {text: "한 쪽 다리를 접어 깔고 앉는다.", score: 1}
      ]
    },
    {
      question: "재미있는 일이 생겼을 때...",
      option: [
        {text: "아주 큰 소리로 즐거움을 숨기지 않고 웃는다.", score: 6},
        {text: "웃지만 그다지 크지 않은 소리로 웃는다.", score: 4},
        {text: "조용히 소리를 별로 내지 않으며 웃는다.", score: 3},
        {text: "오히려 쑥스러운 듯한 미소를 짓는다.", score: 5}
      ]
    },
    {
      question: "사람들이 많은 장소에서...",
      option: [
        {text: "내 존재를 의식하도록 화려한 등장을 한다.", score: 6},
        {text: "아는 사람이 있나 둘러보며 차분히 들어선다.", score: 4},
        {text: "시선을 끌지 않게 최대로 조용히 입장한다.", score: 2}
      ]
    },
    {
      question: "일하다가 방해 받았을 때..",
      option: [
        {text: "그 중간 어딘가 쯤.", score: 4},
        {text: "짜증이 많이 난다.", score: 2},
        {text: "휴식의 기회를 반갑게 맞이한다.", score: 6}
      ]
    },
    {
      question: "내가 제일 좋아하는 색은?",
      option: [
        {text: "빨강이나 오렌지", score: 6},
        {text: "까망", score: 7},
        {text: "노랑이나 연한 파랑", score: 5},
        {text: "하양", score: 2},
        {text: "갈색이나 회색", score: 1}
      ]
    },
    {
      question: "잠자리에서 잠들기 직전에...",
      option: [
        {text: "몸을 똑바로 펴고 누운 포즈이다.", score: 7},
        {text: "엎드린 채로 몸을 죽 편 포즈이다.", score: 6},
        {text: "약간 몸을 둥글린 채로 옆으로 누운 포즈이다.", score: 4},
        {text: "한 팔을 베고 있다.", score: 2},
        {text: "머리를 이불 밑에 넣고 있다.", score: 1}
      ]
    },
    {
      question: "나는 이런 꿈을 자주 꾼다.",
      option: [
        {text: "낙하하는 꿈", score: 4},
        {text: "싸우거나 애 쓰는 꿈", score: 2},
        {text: "무엇이나 누군가를 찾는 꿈", score: 3},
        {text: "날아오르거나 떠오르는 꿈", score: 5},
        {text: "꿈은 잘 꾸지 않는다.", score: 6}
      ]
    }
  ];
  return (
   <div>Hello!!!</div>
  );
}

export default App;
